/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `SPsavings_account_update_validto`(IN savings_account_key_param int, IN effective_date_param date)
BEGIN

update dim_savings
set valid_to = effective_date_param, `version` = `version` + 1
where savings_account_key = savings_account_key_param;

if row_count() <> 1 then
    select concat('SPsavings_account_update_validto for savings account key: ', savings_account_key_param, 
